import React from "react";
import { NavLink } from "react-router-dom";

const Nav=()=>{
    return(
        <div className="Nav">
            <button>button</button>
            <NavLink to='/contact'>Contact</NavLink>
            <NavLink to='/home'>Home</NavLink>
            <NavLink to='/service'>Service</NavLink>
        </div>
    );
}

export default Nav;
